    }

    for (let i = 1; i <= monthDays[monthPagination - 1]; i++) {
      let result = "";
      if (i < 10) {
        i = "0" + i.toString();
      }
      i = i.toString();
      const count = monthlyFetch.filter((element) => element === i).length;
      if (count > 0) {
        result = count;
      }

      arr.push(
        <div className="cell" key={i}>
          <div className="cellTextContainer">
            {formattedDate ===
            `${yearPagination}-${doubleDigitFormatting(
              monthPagination
