        if (emptyCellStartDates[i] === 7) {
          emptyCellsArr.push(2);
        }
      }
      emptyCellsArr[0] = emptyCellsArr[0] - 1;
      emptyCellsArr[1] = emptyCellsArr[1] - 1;
      setEmptyCellStartDates(emptyCellsArr);
